query QueryRenderersRegistrationFlowQuery(
  $saleID: String!
) {
  sale(id: $saleID) {
    name
    ...RegistrationFlow_sale
    __id
  }
  me {
    ...RegistrationFlow_me
    __id
  }
}

fragment RegistrationFlow_sale on Sale {
  ...Registration_sale
  __id
}

fragment RegistrationFlow_me on Me {
  ...Registration_me
  __id
}

fragment Registration_me on Me {
  has_credit_cards
  __id
}

fragment Registration_sale on Sale {
  id
  end_at
  is_preview
  live_start_at
  name
  start_at
  __id
}
